import React, { useState, useEffect } from 'react';

function ExerciseJournal() {
    const [entries, setEntries] = useState(Array.from({ length: 20 }, () => ({ exercise: '', sets: '', reps: '', ampm: '', favorite: false })));

    const handleEntryChange = (index, event) => {
        const { name, value, type, checked } = event.target;
        const newValue = type === 'checkbox' ? checked : value;
        const newEntries = [...entries];
        newEntries[index][name] = newValue;
        setEntries(newEntries);
    };

    const submitEntry = (index) => {
        const entry = { ...entries[index] };
        entry.dateSubmitted = new Date().toLocaleDateString(); // Current date
        entry.timeSubmitted = new Date().toLocaleTimeString(); // Current time

        try {
            const response = fetch('http://localhost:3000/exerciseJournalEntries', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(entry),
            });

            if (!response.ok) {
                throw new Error('Failed to submit entry');
            }

            console.log('Entry submitted successfully');
        } catch (error) {
            console.error('Error submitting entry:', error.message);
        }
    };

    const removeEntry = (index) => {
        const newEntries = [...entries];
        newEntries.splice(index, 1);
        setEntries(newEntries);
    };

    // Fetch exercise data
    useEffect(() => {
        fetchExerciseData();
    }, []);

    const fetchExerciseData = async () => {
        try {
            const response = await fetch('https://work-out-api1.p.rapidapi.com/search', {
                method: 'GET',
                headers: {
                    'X-RapidAPI-Key': '53b8ecad31mshd3ead90d923490bp17852ajsnb678a1515e7c',
                    'X-RapidAPI-Host': 'work-out-api1.p.rapidapi.com'
                }
            });

            if (!response.ok) {
                throw new Error('Failed to fetch exercise data');
            }

            const data = await response.json();
            // Assuming data contains exercise data, update entries with fetched data
            // For example:
            const exercises = data.exercises;
            const updatedEntries = [...entries];
            exercises.forEach((exercise, index) => {
                updatedEntries[index] = {
                    ...updatedEntries[index],
                    exercise: exercise.name,
                    sets: exercise.sets,
                    reps: exercise.reps
                };
            });
            setEntries(updatedEntries);
        } catch (error) {
            console.error('Error fetching exercise data:', error.message);
        }
    };

    return (
        <div style={{ maxWidth: '650px' }}>
            <h5>Exercise Journal</h5>
            <div style={{ maxHeight: '400px', overflowY: 'auto' }}>
                <table style={{ width: '100%', borderCollapse: 'collapse', borderSpacing: '0' }}>
                    <thead>
                        <tr>
                            <th style={{ padding: '5px' }}>Exercise</th>
                            <th style={{ padding: '5px' }}>Sets</th>
                            <th style={{ padding: '5px' }}>Reps</th>
                            <th style={{ padding: '5px' }}>AM/PM</th>
                            <th style={{ padding: '5px' }}>Fav</th>
                            <th style={{ padding: '5px' }}>Submit</th>
                            <th style={{ padding: '5px' }}>Remove</th>
                        </tr>
                    </thead>
                    <tbody>
                        {entries.map((entry, index) => (
                            <tr key={index}>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="exercise"
                                        value={entry.exercise}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="sets"
                                        value={entry.sets}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="text"
                                        name="reps"
                                        value={entry.reps}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <select
                                        name="ampm"
                                        value={entry.ampm}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    >
                                        <option value="AM">AM</option>
                                        <option value="PM">PM</option>
                                    </select>
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <input
                                        type="checkbox"
                                        name="favorite"
                                        checked={entry.favorite}
                                        onChange={(event) => handleEntryChange(index, event)}
                                    />
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <button onClick={() => submitEntry(index)}>Submit Entry</button>
                                </td>
                                <td style={{ padding: '5px' }}>
                                    <button onClick={() => removeEntry(index)}>Remove</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default ExerciseJournal;
